// src/components/Feedback.js
import React from 'react';
import '../styles/Feedback.css';

const Feedback = () => {
  return (
    <div className="feedback">
      <h1>Feedback</h1>
      <p>This is the Feedback page.</p>
    </div>
  );
}

export default Feedback;
